import React, {Suspense, useEffect} from 'react';
import {BlockHeader} from '../globalComponents/blockHeader.jsx';
import {popupElements,createAndAppendPopup,insertPush,popupElementsObject} from './functions.js';
import { triggerFormPushDataSearch } from '../global_functions.js';
import{APILogBuffer,fetchSubmissionResponses} from '../global_functions';
import './pushExample.css';
import '../index.css'

//todo: exit button function into useEffect

function PushExample() {

    var state={
        title: 'Push Notification Example',
        popupCount: 1
    }

    useEffect(() => { 
            createAndAppendPopup();//create pop up

            //exit button click - hide push notificaiton and start searching for push data aain
            popupElements().exitButton.addEventListener("click", () => {
                triggerFormPushDataSearch();
                popupElements().popUpContainer.style.display = 'none';
                console.log('start search')
                APILogBuffer('start search')
            })

            popupElementsObject = popupElementsObject();
    })
  
    return (
    <>
        
        <div className="popup ui outer container p-20">
            <BlockHeader title={state.title}/>
            {/* <h2 className="block-title">Push Notification Example</h2> */}
            <span class='t-center notif-ph'>No Notification Yet Recieved</span>
        </div>
    </>
    );
  }

  export {PushExample}
